zh:
{'name': '張健勳', 'bio': '我是張健勳，來自工業發達的高雄。父親是弱電工程和電子領域的專業人士，他的工作激發了我對電子設備工作原理的好奇，也因如此，我踏入了程式設計領域。在高中時，我選擇了技職體系就讀，在高雄市立中正高工資訊科的三年不但考取了多張證照，更參與了不同的課外活動，包括資訊研究社和Python深度學習電腦視覺應用設計課程。同時也擔任志工，幫助圖書館資訊組檢修校園資訊廣播設備。

到了大學時期，我以技優甄審入學並選擇了國立臺中科技大學的智慧生產工程系，這是一個跨領域結合的科系。在大學時期我接觸了開源社群，也有這樣的機會參加了不同的資訊研討會，也曾於COSCUP閃電秀上發表，社群交流下使我受益良多。

在其他空閒時間，我勇於嘗試不同的新事物。對我而言，面對挑戰是成長的機會，我以專注和堅持的態度克服困難。這種積極的態度使我能夠靈活應對各種情況，並在處理工作上展現出高效率和解決問題的能力。我志在成為一位具有扎實專業知識的工程師。我的目標是持續投身於軟體開發領域，並透過創新與貢獻，為這個領域帶來新的價值與成就。我堅信自己具備持續學習、解決問題的能力，期待在軟體開發這條路上發光發熱，成為一位全能的軟體工程師。'}

