{'name': '國立中央大學資訊電機學院資訊工程學系 蔡宗翰 教授', 'bio': '蔡宗翰教授為國立中央大學資訊工程學系教授，同時受聘於理工屬性的中央大學資工系與人文屬性的中研院人社中心，研究領域涵蓋資訊領域的自然語言處理、電腦視覺等 AI 技術，並將這些 AI 技術用於解決人文研究問題，也就是所謂「數位人文研究」，為台灣少見之跨理工人文的學者。

此外，更愛好寫文章與作詩，因而被稱為「 AI 界李白」。著有《寫給中學生看的AI課（增訂版）》，榮獲第十二屆吳大猷科學普及著作獎青少年科普特別推薦獎。

個人網頁：https://cis.ncu.edu.tw/iTeacher/home/0xf91f62aecb314932c2593a99c0edf493'}

en:
{'name': '國立中央大學資訊電機學院資訊工程學系 蔡宗翰 教授', 'bio': '蔡宗翰教授為國立中央大學資訊工程學系教授，同時受聘於理工屬性的中央大學資工系與人文屬性的中研院人社中心，研究領域涵蓋資訊領域的自然語言處理、電腦視覺等 AI 技術，並將這些 AI 技術用於解決人文研究問題，也就是所謂「數位人文研究」，為台灣少見之跨理工人文的學者。

此外，更愛好寫文章與作詩，因而被稱為「 AI 界李白」。著有《寫給中學生看的AI課（增訂版）》，榮獲第十二屆吳大猷科學普及著作獎青少年科普特別推薦獎。

