{'name': 'pondahai', 'bio': "In the rush of time, we missed out on a golden era—the 1970s, the age of eight-bit computers—a time brimming with opportunities and innovation. However, even though we couldn't experience that era firsthand, we still yearn to relive its beauty, to feel its passion.

We are a group of young enthusiasts, deeply passionate about computer history. We believe that amidst the rapid advancements in technology today, revisiting the progress of the past is crucial for understanding the present and shaping the future. Therefore, we have embarked on a unique project, inviting everyone to relive the golden age of eight-bit computers together.

In our project, we meticulously crafted a Z80 eight-bit computer with a 1970s aesthetic. By utilizing Arduino as the programming loader, we made it more modern and user-friendly. This means that you can effortlessly upload programs onto this microcomputer and experience the charm of eight-bit computing from yesteryears."}

{'name': 'Huanyi (Eric)', 'bio': 'Huanyi Chuang is a co-founder of a digital marketing agency. He’s been in the local WordPress community since 2017, and was an organizer in WCTPE 2018 and 2019, WCTW 2021. He devotes himself to community building and plugins localization.What drives his passion for WordPress? The deeply cherished value of “freedom,” especially the freedom of speech.

Yuli Yang is an owner of a small agency dejavu.studio and a devoted mother of two. She loves her work so much that it doesn’t feel like a job. She has led and currently mentoring WordCamps and WordPress meetups in Taiwan. In her free time, she enjoys gaming and planning fun activities with her kids.

Xini Liu has joined Open Culture Foundation in 2019 to help provide legal and financial services to the community.  She enjoys communicating with the community, providing assistance and caffeine, and is inspired by the community to gain endless energy.'}

zh:
{'name': 'Piyush Aggarwal', 'bio': 'Piyush is a seasoned engineer with over five years of Qt/C++/Linux hacking experience, working in a wide range of domains, from writing low-level drivers for the RPi Pico MCU to writing desktop applications and helping Mercedes Benz stabilize their infotainment experience.

He has contributed to open source by developing KDE Connect for Windows and consequently improving the quality of all kDE apps for Windows.

Through the power of OSS, he manages a personal server transformed into a personal hub with services like Netflix and Google Drive.'}

