zh:
{'name': 'HungWei Chiu', 'bio': 'HungWei was a former member of technical staff at the Open Networking Foundation, focusing on the SDN (Software Defined Networking) and private 5G opensource solution, Aether. He is working on integrating Cloud Native concepts with 5G/LTE Private Edge Cloud to achieve an automated, efficient process in both development and deployment.

HungWei is one of the co-founders of SDNDS-TW and CNTUG, both are local communities based in Taiwan. SDNDS-TW focus on the SDN and networking topics and CNTUG focus on the Cloud Native approaches, in addition, HungWei devoted himself to sharing his knowledge and experience by writing blog posts and delivering the speech in various confluence and meetup, including COSCUP 2018 x openSUSE. Asia GNOME.Asia, Open Source Networking Days Taiwan, GDG DevFest Taipei 2018.

Also, manage the Facebook page, [矽谷牛的耕田筆記](https://www.facebook.com/technologynoteniu) to share knowledge.'}

