zh:
{'name': 'Dr. Jyh-Cheng Chen', 'bio': 'Dr. Jyh-Cheng Chen
Chair Professor, Department of Computer Science, National Chiao Tung University

Jyh-Cheng Chen has been a Faculty Member with National Chiao Tung University (NCTU), Hsinchu, Taiwan since 2010. Prior to that, he was with Bellcore/Telcordia Technologies in New Jersey, USA, and National Tsing Hua University (NTHU), Hsinchu, Taiwan. He was the Convener of Computer Science Program, Ministry of Science and Technology, Taiwan, from 2016-2018. Dr. Chen received numerous awards, including the Outstanding Teaching Awards from both NCTU and NTHU, the Outstanding Research Award from the Ministry of Science and Technology, the Outstanding I. T. Elite Award, Taiwan, the Medal of Honor, Institute of Information & Computing Machinery,  and the Telcordia CEO Award. He is a Fellow of the IEEE and a Distinguished Member of the ACM. He was a member of the Fellows Evaluation Committee, IEEE Computer Society.'}

